const Price = (props) => {

	let priceCalculation =  <td>{props.price} * {props.days} = {props.total_price}</td>;

	if(props.type === 2 && props.days <=3){

		priceCalculation = <td>{props.total_price}</td>;

	}else if(props.type === 3 && props.days <=5){

		priceCalculation = <td>{props.total_price}</td>;
	}

	return (
		{priceCalculation}
	)



}

export default Price
